import React from 'react';
import '../navbar.css';

function NavBar(){
    return(
        <div>
            <h1>hello</h1>
            <image></image>
            <ul>
                <li>Coffee</li>
                <li>Tea</li>
                <li>Milk</li>
            </ul>
            <form>
                <input>Search</input>
            </form>
            <button>Join the community</button>
        </div>
    );
}

export default NavBar;
